# 通用转换函数
def convert_key(key):
    # Embedding 层与时间嵌入层的转换
    new_key = re.sub(r"emb_layers\.1\.", "time_emb_proj.", key)
    if new_key != key:
        return new_key

    # 输入卷积层与输入层的转换
    new_key = re.sub(r"in_layers\.0\.", "conv1.", key)
    if new_key != key:
        return new_key

    # 中间归一化层与输入层的转换
    new_key = re.sub(r"in_layers\.2\.", "norm1.", key)
    if new_key != key:
        return new_key

    # 输出层与输出卷积层及归一化层的转换
    new_key = re.sub(r"out_layers\.0\.", "conv2.", key)
    if new_key != key:
        return new_key

    new_key = re.sub(r"out_layers\.3\.", "norm2.", key)
    if new_key != key:
        return new_key

    # 如果没有匹配规则，返回原始键
    return key

def replace_keys(key):
    new_key = key
    for old, new in replacements.items():
        if key.startswith(old):
            new_key = key.replace(old, new, 1)
            break

    return new_key

def get_new_key(original_key):
    # 优先从 key_map 查找
    if original_key in key_map:
        return key_map[original_key]
    # 如果不在 key_map 中，使用 replace_keys 进行转换
    return replace_keys(original_key)
